import React from 'react';
import { BrowserRouter as Router, Routes, Route } from 'react-router-dom';
import Navbar from './components/Navbar';
import Footer from './components/Footer';
import Hero from './components/Hero';
import TechnicalProcesses from './components/TechnicalProcesses';
import HomePage from './pages/HomePage';
import ServicesPage from './pages/ServicesPage';
import AboutPage from './pages/AboutPage';
import ContactPage from './pages/ContactPage';
import DistillationPage from './pages/DistillationPage';
import ExtractionPage from './pages/ExtractionPage';
import ReactionPage from './pages/ReactionPage';
import RatingCurvesPage from './pages/RatingCurvesPage';
import QMRAAnalysisPage from './pages/QMRAAnalysisPage';
import MachineLearningPage from './pages/MachineLearningPage';
import MechanisticAnalysisPage from './pages/MechanisticAnalysisPage';
import './styles/index.css';

function App() {
  return (
    <Router>
      <div className="app">
        <Navbar />
        <main className="main-content">
          <Routes>
            <Route path="/" element={<HomePage />} />
            <Route path="/services" element={<ServicesPage />} />
            <Route path="/about" element={<AboutPage />} />
            <Route path="/contact" element={<ContactPage />} />
            <Route path="/process/distillation" element={<DistillationPage />} />
            <Route path="/process/extraction" element={<ExtractionPage />} />
            <Route path="/process/reaction" element={<ReactionPage />} />
            <Route path="/analysis/rating-curves" element={<RatingCurvesPage />} />
            <Route path="/analysis/qmra" element={<QMRAAnalysisPage />} />
            <Route path="/analysis/machine-learning" element={<MachineLearningPage />} />
            <Route path="/analysis/mechanistic" element={<MechanisticAnalysisPage />} />
          </Routes>
        </main>
        <TechnicalProcesses />
        <Footer />
      </div>
    </Router>
  );
}

export default App;
